    "2015-09-26T23:07:25.043854",nt"name": "ncdc-storm-events-database",nt"isopen":
    false,nt"url": null,nt"notes": "Storm Data is provided by the National
    Weather Service (NWS) and contain statistics on personal injuries and damage estimates.
    Storm Data covers the United States of America. The data began as early as 1950
    through to the present, updated monthly with up to a 120 day delay possible. NCDC
    Storm Event database allows users to find various types of storms recorded by county,
    or use other selection criteria as desired. The data contain a chronological listing,
    by state, of hurricanes, tornadoes, thunderstorms, hail, floods, drought conditions,
    lightning, high winds, snow, temperature extremes and other weather phenomena.",nt"license_title":
